import * as React from 'react';
import { IconButton } from './IconButton';

interface CheckBoxProps {
  [x: string]: any
}

export const CheckBox: React.FC<CheckBoxProps> = ({ children, ...props }) => {
  if (!props.checked) {
    return (
      <IconButton
        name='ellipse-outline'
        {...props}
      />
    )
  }
  else {
    return (
      <IconButton
        name='checkmark-circle-outline'
        color='green'
        {...props}
      />
    )
  }
}
